// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract BuyMeACoffee {
    // Événements
    event NewCoffee(
        address indexed from,
        uint256 timestamp,
        string name,
        string message,
        uint256 amount
    );

    event WithdrawalSuccessful(
        address indexed owner,
        uint256 amount,
        uint256 timestamp
    );

    // Structure pour stocker les détails de chaque café
    struct Coffee {
        address from;
        uint256 timestamp;
        string name;
        string message;
        uint256 amount;
    }

    // Variables d'état
    address payable public owner;
    Coffee[] public coffees;
    
    // Prix minimum pour un café (en wei) - 0.001 ETH
    uint256 public constant MIN_COFFEE_PRICE = 0.001 ether;
    
    // Mapping pour suivre le total donné par chaque adresse
    mapping(address => uint256) public totalDonatedBy;

    // Modificateurs
    modifier onlyOwner() {
        require(msg.sender == owner, "Seul le proprietaire peut effectuer cette action");
        _;
    }

    modifier validCoffeePrice() {
        require(msg.value >= MIN_COFFEE_PRICE, "Le montant minimum est 0.001 ETH");
        _;
    }

    // Constructeur
    constructor() {
        owner = payable(msg.sender);
    }

    /**
     * @dev Fonction pour acheter un café
     * @param _name Nom de la personne qui achète le café
     * @param _message Message personnalisé
     */
    function buyCoffee(
        string memory _name,
        string memory _message
    ) public payable validCoffeePrice {
        require(bytes(_name).length > 0, "Le nom ne peut pas etre vide");
        
        // Ajouter le café à la liste
        coffees.push(Coffee(
            msg.sender,
            block.timestamp,
            _name,
            _message,
            msg.value
        ));

        // Mettre à jour le total donné par cette adresse
        totalDonatedBy[msg.sender] += msg.value;

        // Émettre l'événement
        emit NewCoffee(
            msg.sender,
            block.timestamp,
            _name,
            _message,
            msg.value
        );
    }

    /**
     * @dev Fonction pour acheter plusieurs cafés d'un coup
     * @param _name Nom de la personne
     * @param _message Message personnalisé
     * @param _count Nombre de cafés à acheter
     */
    function buyMultipleCoffees(
        string memory _name,
        string memory _message,
        uint256 _count
    ) public payable {
        require(_count > 0 && _count <= 10, "Vous pouvez acheter entre 1 et 10 cafes");
        require(msg.value >= MIN_COFFEE_PRICE * _count, "Montant insuffisant pour le nombre de cafes");
        require(bytes(_name).length > 0, "Le nom ne peut pas etre vide");

        uint256 pricePerCoffee = msg.value / _count;

        for(uint256 i = 0; i < _count; i++) {
            coffees.push(Coffee(
                msg.sender,
                block.timestamp,
                _name,
                _message,
                pricePerCoffee
            ));

            emit NewCoffee(
                msg.sender,
                block.timestamp,
                _name,
                _message,
                pricePerCoffee
            );
        }

        totalDonatedBy[msg.sender] += msg.value;
    }

    /**
     * @dev Retrait des fonds par le propriétaire
     */
    function withdrawTips() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "Aucun fonds a retirer");

        (bool success, ) = owner.call{value: balance}("");
        require(success, "Echec du retrait");

        emit WithdrawalSuccessful(owner, balance, block.timestamp);
    }

    /**
     * @dev Retrait partiel des fonds
     * @param _amount Montant à retirer en wei
     */
    function withdrawPartial(uint256 _amount) public onlyOwner {
        require(_amount > 0, "Le montant doit etre superieur a 0");
        require(address(this).balance >= _amount, "Solde insuffisant");

        (bool success, ) = owner.call{value: _amount}("");
        require(success, "Echec du retrait");

        emit WithdrawalSuccessful(owner, _amount, block.timestamp);
    }

    /**
     * @dev Obtenir tous les cafés achetés
     */
    function getCoffees() public view returns (Coffee[] memory) {
        return coffees;
    }

    /**
     * @dev Obtenir le nombre total de cafés
     */
    function getTotalCoffees() public view returns (uint256) {
        return coffees.length;
    }

    /**
     * @dev Obtenir les derniers cafés (limité à 10)
     */
    function getRecentCoffees() public view returns (Coffee[] memory) {
        uint256 totalCoffees = coffees.length;
        uint256 limit = totalCoffees > 10 ? 10 : totalCoffees;
        
        Coffee[] memory recentCoffees = new Coffee[](limit);
        
        for(uint256 i = 0; i < limit; i++) {
            recentCoffees[i] = coffees[totalCoffees - 1 - i];
        }
        
        return recentCoffees;
    }

    /**
     * @dev Obtenir le solde du contrat
     */
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }

    /**
     * @dev Obtenir les statistiques d'un donateur
     * @param _donor Adresse du donateur
     */
    function getDonorStats(address _donor) public view returns (uint256 totalDonated, uint256 coffeeCount) {
        totalDonated = totalDonatedBy[_donor];
        
        coffeeCount = 0;
        for(uint256 i = 0; i < coffees.length; i++) {
            if(coffees[i].from == _donor) {
                coffeeCount++;
            }
        }
    }

    /**
     * @dev Changer le propriétaire du contrat
     * @param _newOwner Nouvelle adresse du propriétaire
     */
    function transferOwnership(address payable _newOwner) public onlyOwner {
        require(_newOwner != address(0), "Nouvelle adresse invalide");
        owner = _newOwner;
    }

    /**
     * @dev Fonction de secours pour recevoir de l'ETH directement
     */
    receive() external payable {
        // Accepter les dons directs sans message
        coffees.push(Coffee(
            msg.sender,
            block.timestamp,
            "Donateur anonyme",
            "Don direct",
            msg.value
        ));

        totalDonatedBy[msg.sender] += msg.value;

        emit NewCoffee(
            msg.sender,
            block.timestamp,
            "Donateur anonyme",
            "Don direct",
            msg.value
        );
    }

    /**
     * @dev Fonction fallback
     */
    fallback() external payable {
        revert("Fonction non reconnue");
    }
}

